import React from 'react';
import CardClasses from './card.module.scss';

const Card = () => {
  return (
    <div className={CardClasses.wrapper}>
      <div className={CardClasses.picture}>
        <div className={CardClasses.compare}>
          <label>
            <input className={CardClasses.compareCheckbox} type="checkbox"/>
            <span className={CardClasses.compareIcon}></span>
          </label>
        </div>
        <div className={CardClasses.like}></div>
        <div className={CardClasses.sliderButtons}></div>
      </div>
      <div className={CardClasses.info}>

      </div>
    </div>
  );
}

export default Card;
